import './App.css';
import Mstitels from './components/mstiteli';


const avengers = [
  {name: "Железный человек", universe: "Мстители", ego: "Тони Старк", job: "гений, миллиардер, плейбой, филантроп", 
  friends: "Мстители", power: "высокий уровень интеллекта, широкие познания науки и техники, связь со всемирной паутиной, бронекостюмы", 
  other: "пожалуй, самый популярный современный супергерой. У него много общего с мрачной птицей ночи Бэтменом: оба потеряли родителей в детстве, стали борцами с преступностью без особых сверхсил, невероятно богатые. Только если Бэтменом восхищаются, то Тони Старка — обожают. То ли дело в шикарной актерской игре Роберта Дауни мл., который выбил роль у Николаса Кейджа и Тома Круза, то ли в хорошо прописанном персонаже. Прототипом для героя послужили Илон Маск и изобретатель Говард Хьюз. Железный Человек не всегда ходил в красном модном костюме: в своих первых версиях 1963 года он был скромного серого цвета. Увы, в киновоплощении бронекостюм даже не из металла — его делали из пластика и стекловолокна."

  }
]

function App() {
  return (
    <div className="App">
      <Mstitels></Mstitels>
    </div>
  );
}

export default App;
